description:
Whether you want to see inside a volcano, understand every component of an engine, or learn the difference between a stegosaurus and a stegoceras, the Ultimate Visual Dictionary will reveal all.

Updated and expanded, this easy-to-use reference covers everything from prehistoric Earth and science, to sports, art, and music. Also includes more than 6,000 full-color photographs and illustrations, and visual definitions of more than 33,000 terms.

The Ultimate Visual Dictionary
Book Language: English 
Pages: 674
File Type: Pdf
File Size: 149.18 MB
